import { Col, Container, Row } from "reactstrap";
import Base from "../components/Base";
import CategoryMenu from "./../components/CategoryMenu";
import NewFeed from './../components/NewFeed';

const Home = () => {
  return (
    <Base>
      {/* <Container className="mt-3"></Container> */}
      <Row>
        <Col md={3}>
          <CategoryMenu />
        </Col>
        <Col md={9}>
          <NewFeed />
        </Col>
      </Row>
    </Base>
  );
};

export default Home;
